import React from "react";

import { createBrowserRouter, useNavigate } from "react-router-dom";

// import components

import Login from '../pages/Login';
import Register from '../pages/Register';
import Dashboard from '../pages/Dashboard';
import PageNotFound from '../pages/PageNotFound';

// import PrivateRoute from "./ProtectedRoute";

const PrivateRoute = async({ element: Component }) => {
    const token = sessionStorage.getItem('userTokenId');
    console.log('TOken',token);
    const navigate = useNavigate();

    const response = await fetch('https://fun-cougar-precisely.ngrok-free.app/api/authverify',{
        method: "GET",
        headers: {
            'Authorization': token
        }
    });
    const data =  await response.json();
    console.log('Auto Data', data);
    //return token != null ? <Component /> :  navigate('/login');
};

const Router = createBrowserRouter([
    {
        path: '/',
        element: <PrivateRoute element={Dashboard} />,
        index: true
    },
    {
        path: '/login',
        element: <Login />
    },
    {
        path: '/register',
        element: <Register />
    },
    {
        path: '*',
        element: <PageNotFound />
    }
]);

 export default Router;
